import React, { Component } from 'react'
import dataSource from './DataSource'

class Blog extends Component {
    render() {
        return (
            <div>
                {
                    dataSource.map((item, index) => {
                        return (
                            <>
                                <h1>{item.title}</h1>
                                <p>{item.content}</p>
                            </>
                        )
                    })
                }
            </div>
        )
    }
}

export default Blog
